import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { Search, Bell, Settings, Menu, X } from 'lucide-react';

export default function DashboardHeader({ onMenuToggle, notificationCount = 0 }) {
  const [searchQuery, setSearchQuery] = useState('');
  const [showNotificationDropdown, setShowNotificationDropdown] = useState(false);

  const handleNotificationClick = () => {
    console.log('Notifications clicked');
    setShowNotificationDropdown(!showNotificationDropdown);
  };

  const handleSettingsClick = () => {
    console.log('Settings clicked');
  };

  return (
    <motion.header
      initial={{ y: -100, opacity: 0 }}
      animate={{ y: 0, opacity: 1 }}
      className="bg-white/95 backdrop-blur-md border-b border-gray-100 sticky top-0 z-40 shadow-sm"
    >
      <div className="w-full px-6 py-4">
        <div className="flex items-center justify-between gap-4">
          {/* Left - Menu and Search */}
          <div className="flex items-center gap-4 flex-1">
            <button
              onClick={onMenuToggle}
              className="lg:hidden hover:bg-gray-100 p-2 rounded-lg transition-colors"
            >
              <Menu className="w-5 h-5 text-gray-600" />
            </button>

            {/* Search Bar */}
            <div className="flex-1 max-w-md">
              <div className="relative">
                <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400 w-4 h-4" />
                <input
                  type="text"
                  placeholder="Search contacts..."
                  value={searchQuery}
                  onChange={(e) => setSearchQuery(e.target.value)}
                  className="w-full pl-10 pr-4 py-2 bg-gray-100 hover:bg-gray-200 focus:bg-white border border-gray-200 focus:border-blue-400 rounded-lg transition-all focus:ring-2 focus:ring-blue-300 text-sm"
                />
              </div>
            </div>
          </div>

          {/* Right - Icons and User */}
          <div className="flex items-center gap-3">
            {/* Notifications */}
            <motion.div
              className="relative"
              whileHover={{ scale: 1.05 }}
            >
              <button
                onClick={handleNotificationClick}
                className="relative p-2 hover:bg-gray-100 rounded-lg transition-all duration-200"
              >
                <Bell className={`w-5 h-5 text-gray-600 transition-all duration-200 ${notificationCount > 0 ? 'animate-pulse' : ''}`} />
                {notificationCount > 0 && (
                  <motion.span
                    initial={{ scale: 0 }}
                    animate={{ scale: 1 }}
                    className="absolute -top-1 -right-1 bg-gradient-to-r from-red-400 to-pink-500 text-white text-xs font-bold rounded-full w-5 h-5 flex items-center justify-center animate-bounce"
                  >
                    {notificationCount}
                  </motion.span>
                )}
              </button>

              {/* Notification Dropdown */}
              {showNotificationDropdown && notificationCount > 0 && (
                <motion.div
                  initial={{ opacity: 0, y: -10 }}
                  animate={{ opacity: 1, y: 0 }}
                  exit={{ opacity: 0, y: -10 }}
                  className="absolute right-0 mt-2 w-64 bg-white rounded-xl shadow-lg border border-gray-100 z-50"
                >
                  <div className="p-4 border-b border-gray-100">
                    <p className="text-sm font-semibold text-gray-900">Notifications</p>
                    <p className="text-xs text-gray-500">You have {notificationCount} pending action{notificationCount > 1 ? 's' : ''}</p>
                  </div>
                  <div className="p-4 max-h-48 overflow-y-auto space-y-2">
                    <div className="text-sm text-gray-600 text-center py-4">
                      Check the Follow-ups panel for details
                    </div>
                  </div>
                </motion.div>
              )}
            </motion.div>

            {/* Settings */}
            <motion.button
              whileHover={{ scale: 1.05, rotate: 12 }}
              onClick={handleSettingsClick}
              className="p-2 hover:bg-gray-100 rounded-lg transition-all duration-200"
            >
              <Settings className="w-5 h-5 text-gray-600" />
            </motion.button>

            {/* User Avatar */}
            <motion.div
              whileHover={{ scale: 1.05 }}
              className="flex items-center gap-3 cursor-pointer hover:bg-gray-100 px-3 py-2 rounded-lg transition-all duration-200"
            >
              <div className="text-right hidden sm:block">
                <p className="text-sm font-medium text-gray-900">User</p>
                <p className="text-xs text-gray-500">Recruiter</p>
              </div>
              <div className="w-8 h-8 bg-gradient-to-br from-blue-400 to-purple-500 rounded-full flex items-center justify-center text-white font-semibold text-sm">
                U
              </div>
            </motion.div>
          </div>
        </div>
      </div>
    </motion.header>
  );
}
